So the #rhinotrekking at Grootberg lodge was worth if for Matt. He saw 3 rhino including a baby. Yes it was an epic journey. Yes it took close to 9 hours door to door. But an authentic experience it most definitely was. These rhino are not collared, or permanently tracked. They are found by the incredible trackers at Grootberg, who have to look within 43000 hectares. The equivalent of twice the size of the Wirral! 

